import React from 'react';
import styled from 'styled-components';

const ReportHeader = styled.div`
    margin-left: 300px; 
`;

export const Reports = (props) => (
    <div>
        <ReportHeader>Reports Page</ReportHeader>
        <p>This will be used as the page that displays reports</p>
    </div>
)
